import React, { useEffect, useState } from "react";
import Head from "next/head";
import Link from "next/link";
import Header from "../../compornents/Header/header";
import Rank from "../../Json/AllJob.json";

const Index = (props) => {
  const [num, setNum] = useState(0);

  useEffect(() => {
    document.querySelector(
      "#__next"
    ).style.backgroundImage = `url(../../images/world/background.png)`;

    document.querySelectorAll(".worldSideBar > li").forEach((li, i) => {
      li.classList.remove("sidebar__group__active");
      li.classList.add("sidebar__group__none");

      if (i == num) li.classList.add("sidebar__group__active");
      else li.classList.add("sidebar__group__none");
    });

    let worldTitle = (document.querySelector(
      ".world__title > h1"
    ).innerHTML = `${worldKo[num]}`);
  });

  const worldEn = [
    "luna",
    "scania",
    "elysium",
    "croa",
    "aurora",
    "bera",
    "red",
    "union",
    "zenith",
    "enosis",
    "arcane",
    "nova",
    "reboot",
    "reboot2",
  ];

  const worldKo = [
    "루나",
    "스카니아",
    "엘리시움",
    "크로아",
    "오로라",
    "베라",
    "레드",
    "유니온",
    "제니스",
    "이노시스",
    "아케인",
    "노바",
    "리부트",
    "리부트2",
  ];

  return (
    <div>
      <Head>
        <title>msg.gg</title>
        <link rel="stylesheet" href="/style/header.css" />
        <link rel="stylesheet" href="/style/world.css" />
        <link
          href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
          rel="stylesheet"
        ></link>
      </Head>
      <Header></Header>
      <div className="wrap">
        <ul className="worldSideBar">
          <li className="worldSideBar__group pointer" onClick={() => setNum(0)}>
            <img src="../../images/world/luna.gif" alt="" />{" "}
            <a href="#">루나</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(1)}>
            <img src="../../images/world/scania.gif" alt="" />{" "}
            <a href="#">스카니아</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(2)}>
            <img src="../../images/world/elysium.gif" alt="" />{" "}
            <a href="#">엘리시움</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(3)}>
            <img src="../../images/world/croa.gif" alt="" />{" "}
            <a href="#">크로아</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(4)}>
            <img src="../../images/world/aurora.gif" alt="" />{" "}
            <a href="#">오로라</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(5)}>
            <img src="../../images/world/bera.gif" alt="" />{" "}
            <a href="#">베라</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(6)}>
            <img src="../../images/world/red.gif" alt="" /> <a href="#">레드</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(7)}>
            <img src="../../images/world/union.gif" alt="" />{" "}
            <a href="#">유니온</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(8)}>
            <img src="../../images/world/zenith.gif" alt="" />{" "}
            <a href="#">제니스</a>
          </li>
          <li className="worldSideBar__group pointer" onClick={() => setNum(9)}>
            <img src="../../images/world/enosis.gif" alt="" />{" "}
            <a href="#">이노시스</a>
          </li>
          <li
            className="worldSideBar__group pointer"
            onClick={() => setNum(10)}
          >
            <img src="../../images/world/arcane.gif" alt="" />{" "}
            <a href="#">아케인</a>
          </li>
          <li
            className="worldSideBar__group pointer"
            onClick={() => setNum(11)}
          >
            <img src="../../images/world/nova.gif" alt="" />{" "}
            <a href="#">노바</a>
          </li>
          <li
            className="worldSideBar__group pointer"
            onClick={() => setNum(12)}
          >
            <img src="../../images/world/reboot.gif" alt="" />{" "}
            <a href="#">리부트</a>
          </li>
          <li
            className="worldSideBar__group pointer"
            onClick={() => setNum(13)}
          >
            <img src="../../images/world/reboot2.gif" alt="" />{" "}
            <a href="#">리부트2</a>
          </li>
        </ul>
        <div className="world__main">
          <div className="world__title d-flex align-items-center">
            <h1>루나</h1>
          </div>
          <div className="world__section mt-5">
            <div className="flex-between">
              <div className="rank__210">
                <p className="pt-3 pl-5">인구수 (Lv210)</p>
                <p className="pt-2">
                  1위 <span>/ 14위</span>
                </p>
                <p className="pt-2">315,379명</p>
              </div>
              <div className="rank__240">
                <p className="pt-3 pl-5">인구수 (Lv210)</p>
                <p className="pt-2">
                  1위 <span>/ 14위</span>
                </p>
                <p className="pt-2">25,125명</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Index;
